import Quiz , {quizTemplate, quizType} from './Quiz'

export default function Line(props){

	switch(props.type){
		case quizType:
			return <Quiz {...props}/>
			break;
		default:
			return <div/>
	}
	return blocks[props.type] 
}

export const lineTypes = ["h1","h2","p","blockquote",quizType]
